import * as React from 'react';
import { Box, AppBar, Toolbar, IconButton, Typography, Menu, Container, Avatar, Button, Tooltip, MenuItem, Divider, Stack } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import ExploreIcon from '@mui/icons-material/Explore';
import StorefrontRoundedIcon from '@mui/icons-material/StorefrontRounded';
import Groups2RoundedIcon from '@mui/icons-material/Groups2Rounded';
import './AppBar.css'

const pages = ['Discover', 'Susita Market', 'Clubs'];


function MobileAppBar(props) {

    const joinNowButtonRef = React.useRef(null);
    const [anchorElNav, setAnchorElNav] = React.useState(null);

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };


    return (
        <AppBar position="static" sx={{ backgroundColor: '#ffffff' }} elevation={0}>
            <Container sx={{ border: "0px solid black", pt: '0px' }}>
                <Box>
                    <Toolbar  >
                        <Typography
                            variant="h6"
                            noWrap
                            component="a"
                            href="/"
                            sx={{
                                mr: 2, display: { xs: 'flex', md: 'flex' }, fontFamily: 'Open Sans', fontWeight: 600, letterSpacing: '.1.5rem',
                                color: '#768A54',
                                textDecoration: 'none'
                            }}
                        >
                            <img src=".\susita_logo_name.png" width={'90px'} height='auto' />
                        </Typography>
                        <Box sx={{ justifyContent: 'flex-end', marginRight: '5%', flexGrow: 1, display: { xs: 'flex', md: 'flex' } }}>
                            <Divider orientation="vertical" variant="middle" flexItem sx={{ borderRightWidth: 2, height: '40px', alignSelf: 'center', ml: '20px' }} />
                            <Button
                                ref={joinNowButtonRef}
                                id="JoinNow"
                                onClick={() => {
                                    props.JoinNowCallBack(joinNowButtonRef.current);
                                }}
                                disabled={false}
                                size="small"
                                variant="text"
                                style={{ borderRadius: '30px' }}
                                sx={{
                                    '&:hover': {
                                        backgroundColor: '#d9d7d7',
                                        color: 'black',
                                        '& > *': { color: 'black' },
                                    },
                                    ml: '1px',
                                    width: '80px',
                                }}>
                                <Typography
                                    sx={{
                                        fontSize: 13, color: '#686869', fontFamily: 'Open Sans', fontWeight: 700,
                                        letterSpacing: '.0.5rem', textTransform: 'none'
                                    }}>
                                    Join now
                                </Typography>
                            </Button>
                            <Button
                                disabled={false}
                                size="small"
                                variant="outlined"
                                style={{ borderRadius: '30px', border: '1px solid #636E51' }}
                                sx={{
                                    '&:hover': {
                                        backgroundColor: '#Eef3eb',
                                        color: 'black',
                                        '& > *': { color: '#383d2f' },
                                    },
                                    ml: '5px',
                                    width: '80px',
                                }}>
                                <Typography
                                    sx={{
                                        fontSize: 13, color: '#686869', fontFamily: 'Open Sans', fontWeight: 700,
                                        letterSpacing: '.0.5rem', textTransform: 'none'
                                    }}>
                                    Sign in
                                </Typography>
                            </Button>
                        </Box>
                    </Toolbar>
                </Box>
            </Container>
        </AppBar>
    );
}
export default MobileAppBar;
